const canvas = document.getElementById('canvas1')
const ctx = canvas.getContext('2d')

const image1 = new Image()
image1.src = 'data:image/png;base64,'

let adjustX = 10
let adjustY = 10
let cellSize =3
let resolution = 4
let spreadSpeed = 5

const mouse ={
    x: null,
    y:null,
    radius: 150
}

window.addEventListener('mousemove',function(event){
    mouse.x = event.x
    mouse.y = event.y
})
class Cell{
    constructor(x,y,color){
        this.x = x
        this.y = y
        this.size= cellSize
        this.baseX = x
        this.baseY = y
        this.color = color
        this.density = Math.random()+0.1
    }
    draw(ctx){
        ctx.fillStyle = this.color
        ctx.beginPath()
        ctx.rect(this.x,this.y,this.size,this.size)
        // ctx.arc(this.x,this.y,this.size,0,Math.PI*2)
        ctx.closePath()
        ctx.fill()
    }
    update(){
        
        let dx =mouse.x -this.x
        let dy = mouse.y - this.y
        let distance = Math.sqrt(dx*dx+dy*dy)
        let forceDirectionX = dx/distance
        let forceDirectionY = dy/distance
        let force = (mouse.radius-distance)/mouse.radius
        let directionX = forceDirectionX*force/this.density*spreadSpeed
        let directionY = forceDirectionY*force/this.density*spreadSpeed
        if(distance<mouse.radius){
            this.x -= directionX
            this.y -= directionY
        }else{
            if(this.x!== this.baseX){
                let dx = this.baseX-this.x
                this.x += dx/10
            }
            if(this.y!== this.baseY){
                let dy = this.baseY-this.y
                this.y += dy/10
            }
        }
        
    }
}
class AsciiEffect{
    #imageCellArray = []
    #pixels=[]
    #ctx
    #width
    #height
    constructor(ctx,width,height){
        this.#ctx =ctx
        this.#width = width
        this.#height = height
        this.#ctx.drawImage(image1,0,0,this.#width,this.#height)
        this.#pixels = this.#ctx.getImageData(0,0,this.#width,this.#height)
        this.#ctx.clearRect(0,0,this.#width,this.#height)
    }
    #scanImage(){
        this.#imageCellArray = []
        for(let y =0;y<this.#pixels.height;y+=resolution){
            for(let x = 0;x<this.#pixels.width;x+=resolution){
                let pos = (y*this.#pixels.width*4)+x*4
                if(this.#pixels.data[pos+3]>128){
                    const red= this.#pixels.data[pos]
                    const green= this.#pixels.data[pos+1]
                    const blue= this.#pixels.data[pos+2]
                    const color = `rgb(${red},${green},${blue})`
                    this.#imageCellArray.push(new Cell(x+adjustX,y+adjustY,color))
                }
            }
        }
    }
    drawAscii(){
        this.#imageCellArray.forEach(cell => {
            cell.draw(this.#ctx)
            cell.update()
        })
    }
    drawImage(){
        this.#scanImage()
        this.drawAscii()
    }
}
let effect
function animation(){
    effect.drawAscii()
    ctx.fillStyle = 'rgba(0,0,0,.2)'
    ctx.fillRect(0,0,canvas.width,canvas.height)
    requestAnimationFrame(animation)
}
function init(){
    canvas.width = image1.width
    canvas.height = image1.height
    effect= new AsciiEffect(ctx,canvas.width,canvas.height)
    effect.drawImage()
}
image1.addEventListener('load',function(){
    init()
    animation()
})
window.addEventListener('resize',function(){
    init()
})
